import React, { useEffect, useMemo, useState } from "react";
import styled from "styled-components/macro";
import { useDispatch, useSelector } from "react-redux";
import {
  HeaderContainer,
  ListingItemContainer,
  // AdvancedSearchContainer,
  FooterContainer,
} from "../containers";
import { Section } from "../components";
import { getPropertyList } from "../redux/actions/propertiesAction";

/* -------------------- Local page styles -------------------- */
const PageWrap = styled.div`
  width: min(1200px, 92%);
  margin: 0 auto;
`;

const Toolbar = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  gap: 12px;
  margin: 6px 0 14px;
`;

const Count = styled.span`
  color: #6b7280;
`;

const SortWrap = styled.div`
  display: flex;
  align-items: center;
  gap: 8px;

  label {
    font-size: 0.95rem;
    color: #374151;
  }

  select {
    padding: 8px 10px;
    border-radius: 8px;
    border: 1px solid #e5e7eb;
    background: #fff;
    outline: none;
  }
`;

const Grid = styled.div`
  display: grid;
  grid-template-columns: repeat(4, minmax(0, 1fr));
  gap: 24px;

  @media (max-width: 1200px) { grid-template-columns: repeat(3, 1fr); }
  @media (max-width: 900px)  { grid-template-columns: repeat(2, 1fr); }
  @media (max-width: 560px)  { grid-template-columns: 1fr; }
`;

const Empty = styled.p`
  width: 100%;
  text-align: center;
  color: #6b7280;
  padding: 40px 0;
  margin: 0;
`;
/* ----------------------------------------------------------- */

const Listing = () => {
  const dispatch = useDispatch();
  const listState = useSelector((state) => state.propertyList);
  const properties = listState?.properties || [];

  const [sort, setSort] = useState("newest");

  useEffect(() => {
    dispatch(getPropertyList());
  }, [dispatch]);

  // optional client-side sort (safe defaults)
  const sorted = useMemo(() => {
    const arr = [...properties];
    if (sort === "price-asc") {
      arr.sort((a, b) => Number(a.price) - Number(b.price));
    } else if (sort === "price-desc") {
      arr.sort((a, b) => Number(b.price) - Number(a.price));
    } else if (sort === "title") {
      arr.sort((a, b) => String(a.title || "").localeCompare(String(b.title || "")));
    } else {
      // "newest" – if you have createdAt, use it; otherwise leave as-is
      // arr.sort((a,b) => new Date(b.createdAt) - new Date(a.createdAt));
    }
    return arr;
  }, [properties, sort]);

  return (
    <>
      <HeaderContainer bg="false" />

      <Section bgColor="--bs-fade-info" style={{ marginTop: "88px" }}>
        <Section.InnerContainer>
          <Section.Flex>
            {/* Left column: reserved for filters/search (kept for future) */}
            <Section.FlexItem width="30%" relative flexStart>
              <Section.Shadow>
                {/* <AdvancedSearchContainer /> */}
              </Section.Shadow>
            </Section.FlexItem>

            {/* Right column: listings */}
            <Section.FlexItem width="65%">
              <PageWrap>
                <Section.Title>Our Property List</Section.Title>

                <Toolbar>
                  <Count>{sorted.length} properties</Count>
                  <SortWrap>
                    <label htmlFor="sort">Sort</label>
                    <select
                      id="sort"
                      value={sort}
                      onChange={(e) => setSort(e.target.value)}
                    >
                      <option value="newest">Newest</option>
                      <option value="price-asc">Price ↑</option>
                      <option value="price-desc">Price ↓</option>
                      <option value="title">Title A–Z</option>
                    </select>
                  </SortWrap>
                </Toolbar>

                {sorted.length === 0 ? (
                  <Empty>No properties found.</Empty>
                ) : (
                  <Grid>
                    {sorted.map((featured) => (
                      <ListingItemContainer
                        key={featured.id}
                        featured={featured}
                      />
                    ))}
                  </Grid>
                )}

                <Section.Footer style={{ marginTop: "18px" }}>
                  <Section.Button>More Listing</Section.Button>
                </Section.Footer>
              </PageWrap>
            </Section.FlexItem>
          </Section.Flex>
        </Section.InnerContainer>
      </Section>

      <FooterContainer />
    </>
  );
};

export default Listing;
